import AppLayout from "../component/AppLayout";
import { Input } from "antd";

const Home = () => {
  const onSearch = (value) => console.log(value);
  return (
    <AppLayout version="3.5-turbo">
      <Input.Search
        placeholder="input search text"
        onSearch={onSearch}
        allowClear
        enterButton="Search"
        size="large"
      ></Input.Search>
      <Input.TextArea rows={4} readOnly></Input.TextArea>
    </AppLayout>
  );
};

export default Home;
